import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';

function Step5(props) {

  let dispatch = useDispatch();

  const goForward = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 6, step_number: 5 }
    });
    props.history.push('./back-to-black');
  }

  const goBack = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 6, step_number: 3 }
    });
    props.history.push('./driveway');
  }

  return (
    <div className='quote'>

      <h2>Would you like us to shovel and salt any sidewalks?</h2>

      <input type="radio" id="single_sidewalk" name="driveway" value="Single Sidewalk" />
      <label htmlFor="single_sidewalk">Single Sidewalk</label>
      <input type="radio" id="double_sidewalk" name="driveway" value="Double Sidewalk" />
      <label htmlFor="double_sidewalk">Double Sidewalk</label>
      <input type="radio" id="triple_sidewalk" name="driveway" value="Triple Sidewalk" />
      <label htmlFor="triple_sidewalk">Triple Sidewalk</label>
      <input type="radio" id="different_driveway" name="driveway" value="My driveway is different" />
      <label htmlFor="different_driveway">My driveway is different</label>

      <br></br>
      <button onClick={goBack}>Go to driveway</button>
      <button onClick={goForward}>Go to Back to Black</button>

    </div>
  );
}

export default connect()(withRouter(Step5));
